var i = 1;
var j = 1;
var k = 0;

var seconds = 0;
var tsCounter = 0;
var noCounter = 0;
var nextCounter;

var noTimestamp = noTimestamps();
var withTimestamp = withTimestamps();

var image = document.createElement("img");
image.src = chrome.extension.getURL("frequency.png");

var divClass = "watch-sidebar-gutter   yt-card yt-card-has-padding    yt-uix-expander yt-uix-expander-collapsed";

// adds container and header
$('#watch7-content').prepend('<div class="' + divClass + '"><img id="frequency" class="freqImage" src="'+image.src+'"/></div>');
$('#watch7-sidebar').prepend('<div id="comment-container" class="watch-sidebar comment-container"></div>');
$('#comment-container').before('<div id="comment-header"><p class="comment-header"><strong>Comments</strong></p></div>');

$(document).ready(function() {
    
            
            auto_refresh();
            
		});
function auto_refresh(){
        
    nextCounter = tsCounter + 1;
    
    if (seconds >= parseInt(withTimestamp[tsCounter]["timestamp"]) )
    {
        addComment(withTimestamp[tsCounter]["author"], withTimestamp[tsCounter]["comment"].slice(0, -3), toTimestamp(parseInt(withTimestamp[tsCounter]["timestamp"])));
        if(parseInt(withTimestamp[tsCounter]["timestamp"]) == parseInt(withTimestamp[nextCounter]["timestamp"])) {
            setTimeout(function(){
            addComment(withTimestamp[nextCounter]["author"], withTimestamp[nextCounter]["comment"].slice(0, -3), toTimestamp(parseInt(withTimestamp[nextCounter]["timestamp"])));
            tsCounter++;
            }, 700);
            
        }
        
        
        tsCounter++;
        
    }
    else
    {
        addComment(noTimestamp[noCounter]["author"], noTimestamp[noCounter]["comment"].slice(0, -3), toTimestamp(null));
        noCounter++;           
    } 
    
    
    seconds++;
    

}
var refreshId = setInterval(auto_refresh, 1000);

function addComment(author, content, time){

    var comment = '<div id="'+i+'" class="' + divClass + '"><p><span class="comment-author">' + author + '</span><span class="comment-time">' + time + '</span></p><p class="comment-body">' + content + '</p></div>';
    
    $(comment).prependTo('#comment-container').hide().slideDown(1000, 'linear');
    

}

function toTimestamp(time)
{
    if (time == null)
        return "";
    return " at " + Math.floor(time / 60).toString() + ":" +  ("0" + (time % 60)).slice(-2).toString();
}


